css:
@-moz-document domain(gtoria.net) 
{
.navbar-brand img
{
  content: url("https://i.imgur.com/uS7Vo8G.png");
  }


.navbar,
.navbar-default
  {
  background-color: #772953;
  }
  
.btn-primary {
    --bs-btn-color: #fff;
    --bs-btn-bg: #e95420;
    --bs-btn-border-color: #e95420;
    --bs-btn-hover-color: #fff;
    --bs-btn-hover-bg: #c6471b;
    --bs-btn-hover-border-color: #ba431a;
    --bs-btn-focus-shadow-rgb: 236, 110, 65;
    --bs-btn-active-color: #fff;
    --bs-btn-active-bg: #ba431a;
    --bs-btn-active-border-color: #af3f18;
    --bs-btn-active-shadow: inset 0 3px 5px rgba(0, 0, 0, 0.125);
    --bs-btn-disabled-color: #fff;
    --bs-btn-disabled-bg: #e95420;
    --bs-btn-disabled-border-color: #e95420;
}

.btn-primary {
    color: #ffffff;
    background-color: #e95420;
    border-color: #e95420;
}
.btn-info {
    color: #ffffff;
    background-color: #17a2b8;
    border-color: #17a2b8;
}
.btn-default {
    color: #555555;
    background-color: #e9ecef;
    border-color: #e9ecef;
}
body {
    font-family: "Ubuntu", Tahoma, "Helvetica Neue", Helvetica, Arial, sans-serif;
    font-size: 14px;
    line-height: 1.42857143;
    color: #333333;
    background-color: #ffffff;
}
.btn {
    display: inline-block;
    margin-bottom: 0;
    font-weight: normal;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    -ms-touch-action: manipulation;
    touch-action: manipulation;
    cursor: pointer;
    background-image: none;
    border: 1px solid transparent;
    padding: 8px 12px;
    font-size: 14px;
    line-height: 1.42857143;
    border-radius: 4px;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
}
.navbar-inverse .navbar-nav > li > a {
    color: #ffffff;
}
}
